import logo from './logo.svg';
import './App.css';

const App = () => {
  return (
    <div>
      <div><Header /></div>
      <div className="App">
        <h1>Hello, people</h1>
        <a>Home</a>
        <a>News Feed</a>
        <a>Messages</a>
    </div>
    </div>
  );
}

const Header = () => {
  return (
      <div className="App">
        <h1>Hello, people</h1>
        <a>Home</a>
        <a>News Feed</a>
        <a>Messages</a>
    </div>
  );
}


export default App;
